            @Override
            public Tuple2<String, String> call(String s) throws Exception {
                return new Tuple2<>(s, s);
            }
        }));

        // Calculate cache hit rate
        JavaPairRDD<String, Double> cacheHitRate = onsiteAttributedDataWithTopFrequentQueries.mapToPair(new PairFunction<Tuple2<String, String[]>, String, Double>() {
