            public Tuple2<String, Double> call(Tuple2<String, String[]> t) throws Exception {
                String query = t._1;
                String[] data = t._2;
                long count = 0;
                long total = 0;
                for (String[] d : data) {
                    if (d[0].equals(query)) {
                        count++;
                    }
                    total++;
                }
                double hitRate = (double) count / total;
                return new Tuple2<>(query, hitRate);
            }
        });

        // Save cache hit rate to output
        cacheHitRate.saveAsTextFile("cache_hit_rate.txt");
    }
}
