Static Variables:
A static variable is a variable that retains its value between function calls. It is initialized only once, when the program starts, and retains its value until the program terminates. Static variables are declared using the static keyword.
Here is an example of a static variable:
```
#include <stdio.h>

static int count = 0;

void increment() {
    count++;
    printf("Count: %d\n", count);
}

int main() {
    increment();
    increment();
    return 0;
}
```
In this example, the static variable `count` is initialized to 0 when the program starts. The `increment` function increments the value of `count` and prints it. When the program calls `increment` twice, the value of `count` is printed as 1 and then 2.

Register Variables:
A register variable is a variable that is stored in a register, which is a small amount of memory that is built into the CPU. Register variables are declared using the register keyword.
Here is an example of a register variable:
```
#include <stdio.h>

register int x;

int main() {
    x = 10;
    printf("x: %d\n", x);
    return 0;
}
```
In this example, the register variable `x` is declared and initialized to 10. The value of `x` is printed to the console.

