Here is a simple example of a DNS server in Go:

```go
package main

import (
	"fmt"
	"log"
	"net"
	"sync"
)

type dnsServer struct {
	mu    sync.Mutex
	cache map[string][]net.IP
}

func (s *dnsServer) ServeDNS(w net.ResponseWriter, r *net.ReadWriter) {
	// Parse the DNS query
	m := new(net.DNSMessage)
	err := m.Read(r)
	if err != nil {
		log.Println(err)
		return
	}

	// Check if the query is for a hostname
	if m.QType != net.DNSQTypeA && m.QType != net.DNSQTypeAAAA {
		log.Println("Unsupported query type")
		return
	}

	// Resolve the hostname
	ips, err := net.LookupHost(m.QName)
	if err != nil {
		log.Println(err)
		return
	}

	// Store the result in the cache
	s.mu.Lock()
	defer s.mu.Unlock()
	s.cache[m.QName] = ips

	// Forward the query to 8.8.8.8 and 1.1.1.1
	for _, ip := range []string{"8.8.8.8", "1.1.1.1"} {
		conn, err := net.Dial("udp", ip+":53")
		if err != nil {
			log.Println(err)
			continue
		}
		defer conn.Close()
		m.Write(conn)
	}

	// Write the response
	w.Write(m)
}

func main() {
	srv := &dnsServer{
		cache: make(map[string][]net.IP),
	}

	ln, err := net.Listen("udp", ":53")
	if err != nil {
		log.Fatal(err)
	}
	defer ln.Close()

	log.Println("DNS server listening on port 53")

	for {
		conn, err := ln.Accept()
		if err != nil {
			log.Println(err)
			continue
		}
		go srv.ServeDNS(conn)
	}
